const fs = require("fs");

// Read the image file
const image = fs.readFileSync("public/images/literarycollection-i-button.png");

// Convert to Base64
const base64Image = Buffer.from(image).toString("base64");

// Create the data URL
const dataUrl = `data:image/png;base64,${base64Image}`;

console.log(dataUrl);

